import React from 'react';
import './SearchForm.css';

function SearchForm() {
    return (
        <form className="searchform">
            <input 
            className="searchform__input"
            placeholder="Введите тему новости" 
            />
            <button className="searchform__btn">Искать</button>
        </form>
    )
}

export default SearchForm;
